import React from 'react'
import { Button, Form, FloatingLabel } from 'react-bootstrap'
import { Link } from 'react-router-dom'

const EstablishmentForm = () => {

    const [person, setPerson] = useState()
    const [title, setTitle] = useState()

    // var data = isAgency ? {
    //     contactPerson: contactPerson,
    //     companyName: companyName,
    //     contactNumber: '',
    //     email: email,
    //     premiumExpiry: ''
    // } : {
    //     contactPerson: contactPerson,
    //     companyName: companyName,
    //     contactNumber: '',
    //     email: email,
    //     userTitle: ''
    // }

    // if (!errorCheck) {
    //     results.post('/users/' + userType + '.json', data)
    //         .then(function (response) {
    //             setSuccess(true)
    //         })
    //         .catch(function (error) {
    //             setError('database fail');
    //         });
    //     setLoading(false)
    // }

    return (
        <div>
            <Form>
                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Contact Person Name"
                    >
                        <Form.Control
                            required
                            type="text"
                            placeholder="Contact Person Name"
                            onChange={(e) => setPerson(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>

                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Contact Person Title"
                    >
                        <Form.Control
                            required
                            type="text"
                            placeholder="Contact Person Title"
                            onChange={(e) => setTitle(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>

                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Company Name"
                    >
                        <Form.Control
                            required
                            type="text"
                            placeholder="Company Name"
                            onChange={(e) => setCompany(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>

                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Contact Number"
                    >
                        <Form.Control
                            required
                            type="text"
                            placeholder="ContactNumber"
                            onChange={(e) => setNumber(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>

                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Password"
                    >
                        <Form.Control
                            required
                            type="password"
                            placeholder="Password"
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>
                <Form.Group>
                    <FloatingLabel
                        className="mb-3"
                        label="Confirm Password"
                    >
                        <Form.Control
                            required
                            type="password"
                            placeholder="Confirm Password"
                            onChange={(e) => setConfirmPassword(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>
                <Form.Group className="d-flex">
                    <Form.Check
                        type="checkbox"
                        onClick={handleCheck}
                    />
                    <Form.Label>
                        <p className='ms-2'>By signing up you accept the
                            <Link className='link-format red-font' to='/tos'> Terms of Service </Link>
                            and
                            <Link className='link-format red-font' to='/privacy'> Privacy Policy </Link>
                        </p>
                    </Form.Label>
                </Form.Group>
                <div className="d-grid gap-2">
                    <Button
                        variant="danger"
                        type="submit"
                        disabled={loading}
                        onClick={handleSubmit}
                    >
                        Register
                    </Button>
                </div>
            </Form>
        </div>
    )
}

export default EstablishmentForm
